import React from 'react'
import { useForm} from "react-hook-form";
import Axios from 'axios'
import {useHistory} from 'react-router-dom'
import {Url,headers} from '../config'
const AddPaciente = () => {
  headers.Authorization = 'Bearer ' + localStorage.getItem('Token')
  const history = useHistory()
  const { register, handleSubmit, formState:{errors}  } = useForm();
  const addPaciente=async (data)=>{
    let datos = { Cedula:data.Cedula, Nombre:data.Name}
    console.log(headers)
    try {
      const res = await Axios.post(Url+"Paciente/New",datos,{headers})
      console.log(res)
      if(res.data.ok) history.push('/Dashboard?action=2')
    } catch (error) {
      console.log(error)
    }

  }



  return (
    <form onSubmit={handleSubmit(addPaciente)} className='flex flex-col bg-white w-auto p-4 '>
        <label className='mt-4 mb-1' htmlFor="cedula">Cedula</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Cedula" id="Cedula" pattern='[0-9]{10}' minLength={10} maxLength={10} placeholder='Cedula del Paciente'
        {...register('Cedula',{
          required:{
            value:true,
            message:"Numero de Cedula es Obbligatrio"
          }
        })} />  
        <span className='Warring'>{errors.Cedula && errors.Cedula.message }</span>
        <label className='mt-4 mb-1' htmlFor="Nombre">Nombre</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre"  placeholder='Nombre del Paciente'
        {...register('Name',{
          required:{
            value:true,
            message:'Nombre es obligatorio'
        }})}
        />
       <span className='Warring'>{errors.Name && errors.Name.message }</span>
        <input className='m-auto w-2/3 my-6' type="submit" value="Agregar" />
    </form>
  )
}

export default AddPaciente
